import './HomeSales.css';

function HomeSales() {
    return (
        <div>
            <header>
                <h1>Welcome to Our Marketplace</h1>
                <p>Discover a wide range of products!</p>
                <button type="button" class="btn btn-outline-primary">Primary</button>
            </header>
        </div>
    );
}

export default HomeSales
